import React, {useState, useEffect} from 'react'
import axiosWithAuth from '../axiosWithAuth'
import OperatorDetails from './OperatorDetails'
import Operatorheader from '../Headers/Operatorheader'
import { OperatorBody, OperatorText } from '../../styled-components'
import jwt_decode from "jwt-decode";

export default function OperatorDashboard(match) {
    const [item, setItem] = useState([]);
    const [truck, setTrucks] = useState([]);
    console.log(match)
    const [operator, setOperator] = useState(localStorage.getItem('token'))
    console.log(operator)
    let decoded = jwt_decode(operator);
    console.log(decoded.sub)
 




    useEffect(()=>{
        axiosWithAuth().get(`/api/ops/${decoded.sub}`)
        .then(res =>{
            console.log(res.data.data)
            setItem(res.data.data)
        })
        .catch(err =>{
            console.log(err, 'No data Coming in!')
        })
    },[])
    




    return (
        <>
        <Operatorheader/>
        <OperatorBody>
        <h1>Welcome: {item.username}</h1>
        <h2>Current Active Operators</h2>
        <OperatorText>
            </OperatorText>
           
            </OperatorBody>
        </>

    )
}
